drop table if exists parks;
create table parks (
	FID VARCHAR(100), 
	areal_id INT, 
	park_id INT, 
	parktype VARCHAR(100), 
	navn_parker VARCHAR(100), 
	undernavn VARCHAR(100), 
	bydelsnavn VARCHAR(100), 
	ejerforhold VARCHAR(100), 
	ejer VARCHAR(100), 
	areal INT, 
	wkb_geometry GEOMETRY NOT NULL SRID 4326,
	primary key(FID)
);
